import "./App.css";

function App() {
  return (
    <div className="">
      <header className=""></header>
      <div>
        <h1>Tom England</h1>
        <h2>
          Determined, enthusiastic individual with over a years self taught
          experience in web development including HTML CSS Javascript and React.
        </h2>
        <h2>Contact details</h2>
        <h2>Email</h2>
        <p>tomengland1995@gmail.com</p>
        <h2>Portfolio</h2>
        <p>tom-webdev.co.uk</p>
        <h2>Git</h2>
        <p>https://github.com/TomHFE</p>
      </div>
    </div>
  );
}

export default App;
